import React from 'react';

class UsersOnline extends React.Component {

    userMenu = () => {

    };

    render() {
        const usersOnlineStyle = {
            float: 'right',
            width: '400px',
            height: '600px',
            border: 'black 2px solid',
            padding: '20px'
        };
        const usersOnline = this.props.usersOnline.map((user, i) => {
            return (
                <div key={i}>
                    <img src={user.avatar} style={{cursor: 'pointer'}} onClick={this.userMenu}/>{user.nickname}
                    <div></div>
                </div>
            )
        });
        return (
            <div style={usersOnlineStyle}>
                {usersOnline}
            </div>
        )
    }
}

export default UsersOnline;
